import Head from 'next/head';
import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';

/** @jsx jsx */
/** @jsxFrag React.Fragment */
import { jsx, css } from '@emotion/core';

const h1 = css`
  font-family: 'Julius Sans One', sans-serif;
  font-size: 2rem;
  color: #ffff;
`;

const paragraph = css`
  font-family: 'Julius Sans One', sans-serif;
  font-size: 1.6rem;
  color: #ffff;
`;

const img = css`
  width: 20%;
`;

const container = css`
  z-index: -1;
  background-size: cover;
  background: #f26968;
`;

const app = css`
  min-height: 100vh;
`;

const imgContainer = css`
  display: flex;
  flex-direction: row;
  justify-content: center;
  margin-top: 20px;
`;

export default function App() {
  return (
    <div css={app}>
      <style>
        @import
        url('https://fonts.googleapis.com/css2?family=Kalam:wght@300&display=swap');
      </style>
      <Header />
      <div>
        <Head>
          <title>Create Next App</title>
          <link rel="icon" href="/favicon.ico" />
        </Head>

        <main css={container}>
          <h1 css={h1}>Wolfi helps you in your journey...</h1>

          <p css={paragraph}>
            Wolfi is your personalised plan based on your interests!
          </p>
          <div css={imgContainer}>
            <img css={img} src="/appPics.png" alt="App's insight" />
            <img css={img} src="/appPics.png" alt="App's insight" />
          </div>
        </main>

        <Footer />

        <style jsx>{`
          .grid {
            display: flex;
            align-items: center;
            justify-content: center;
            flex-wrap: wrap;

            max-width: 800px;
            margin-top: 3rem;
          }

          .card {
            margin: 1rem;
            flex-basis: 45%;
            padding: 1.5rem;
            text-align: left;
            color: inherit;
            text-decoration: none;
            border: 1px solid #eaeaea;
            border-radius: 10px;
            transition: color 0.15s ease, border-color 0.15s ease;
          }

          .card:hover,
          .card:focus,
          .card:active {
            color: #0070f3;
            border-color: #0070f3;
          }

          .card h3 {
            margin: 0 0 1rem 0;
            font-size: 1.5rem;
          }

          .card p {
            margin: 0;
            font-size: 1.25rem;
            line-height: 1.5;
          }

          .logo {
            height: 1em;
          }

          @media (max-width: 600px) {
            .grid {
              width: 100%;
              flex-direction: column;
            }
          }
        `}</style>

        <style jsx global>{`
          html,
          body {
            padding: 0;
            margin: 0;
            font-family: -apple-system, BlinkMacSystemFont, Segoe UI, Roboto,
              Oxygen, Ubuntu, Cantarell, Fira Sans, Droid Sans, Helvetica Neue,
              sans-serif;
          }

          * {
            box-sizing: border-box;
          }
        `}</style>
      </div>
    </div>
  );
}
